00029                 LexHashtagVisualStudioVersion();
00030             else if (_stringWalker.PeekForSubstring(LexSolutionFacts.Header.EXACT_VISUAL_STUDIO_VERSION_START_TOKEN))
00031                 LexExactVisualStudioVersion();
00032             else if (_stringWalker.PeekForSubstring(LexSolutionFacts.Header.MINIMUM_VISUAL_STUDIO_VERSION_START_TOKEN))
00033                 LexMinimumVisualStudioVersion();
