00317     private void LexPropertyNameAndValuePairs(Func<bool> outerLoopBreakPredicate)
00318     {
00319         while (!_stringWalker.IsEof)
00320         {
00321             _ = _stringWalker.ReadWhitespace();
00322 
00323             if (outerLoopBreakPredicate.Invoke())
00324             {
00325                 _stringWalker.BacktrackCharacter();
00326                 break;
00327             }
00328 
00329             var propertyNameStartPosition = _stringWalker.PositionIndex;
00330             var name = _stringWalker.ReadUntil('=');
00331 
00332             var nameNoWhitespace = name.TrimEnd();
00333 
00334             var nameTrailingWhitespaceCount = name.Length - nameNoWhitespace.Length;
00335 
00336             var propertyNameTextSpan = new TextEditorTextSpan(propertyNameStartPosition, _stringWalker, (byte)HtmlDecorationKind.AttributeName);
00337             propertyNameTextSpan = propertyNameTextSpan with
00338             {
00339                 EndingIndexExclusive = propertyNameTextSpan.EndingIndexExclusive - nameTrailingWhitespaceCount
00340             };
00341 
00342             _syntaxTokenList.Add(new AssociatedNameToken(propertyNameTextSpan));
00343 
00344             if (_stringWalker.IsEof)
00345                 return;
00346 
00347             _ = _stringWalker.ReadCharacter();
00348             _ = _stringWalker.ReadWhitespace();
00349 
00350             var propertyValueStartPosition = _stringWalker.PositionIndex;
00351             var value = _stringWalker.ReadLine();
00352 
00353             var valueNoWhitespace = value.TrimEnd();
00354 
00355             var valueTrailingWhitespaceCount = value.Length - valueNoWhitespace.Length;
00356 
00357             var propertyValueTextSpan = new TextEditorTextSpan(propertyValueStartPosition, _stringWalker, (byte)HtmlDecorationKind.AttributeValue);
00358 
00359             propertyValueTextSpan = propertyValueTextSpan with
00360             {
00361                 EndingIndexExclusive = propertyValueTextSpan.EndingIndexExclusive - valueTrailingWhitespaceCount
